 import React from "react";
import "./rightbar.css";
import {Users} from "../../dummyData";
import Online from "../online/Online";
 const Rightbar = ({profile})=>{

const HomeRightbar = ()=>{
return(<>
     <div className="birthdayContainer">
      <img className="birthdayImg" src="assets/Img/gift.png" alt=""/>
      <span className="birthdayText">
      <b>shubh</b> and <b>3 other friends</b> birthday today
      </span>
            </div>
            <img className="rightbarAd" src="assets/Img/frut1.jpg" alt="" />
            <h4 className="rightbarTitle">Online Friends</h4>
            <ul className="rightbarFriendList">
             {Users.map(u=>(
              <Online key ={u.id} user={u} />
              ))}
             
            </ul>
  </>
  );

};
 
const profileRightbar1 = ()=>{
    return(<>
     <div className="birthdayContainer">
      <img className="birthdayImg" src="assets/Img/gift.png" alt=""/>
      <span className="birthdayText">
      <b>shubhamm</b> and <b>3 other friends</b> birthday today
      </span>
            </div>
            <img className="rightbarAd" src="assets/Img/frut1.jpg" alt="" />
            <h4 className="rightbarTitle">Online Friends</h4>
            <ul className="rightbarFriendList">
             {Users.map(u=>(
              <Online key ={u.id} user={u} />
              ))}
             
            </ul>
  </>);
};

 	return(
      <div className="rightbar">
      <div className="rightbarWrapper">
          <profileRightbar1/>
    </div>
 		</div>);
 };

 export default Rightbar;
